import React from 'react'
import { useNavigate } from 'react-router-dom'

const Navbar = (props) => {
    const navigate = useNavigate()
    const toLogin = () =>{
        navigate('/login')
    }
  return (
    <div className='flex justify-center'>
       <div className='flex justify-between px-6 w-full'>
       <span className='font-bold m-1 text-lg'>{props.logo}</span>
        {/* <span>{props.logo}</span> */}
        {props.l}
        <button onClick={toLogin} className='px-2 m-1 rounded-lg text-white hover:bg-blue-500 bg-sky-400'>Login</button>
       </div>

    </div>
  )
}

export default Navbar
